function Instructor() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/instructor" component = {StudentLogin} />
        <Route path="/student/create" component = {CreateStudentAccount} />
      </div>
    </Router>
  );
}
